/* eslint-disable max-len */
/* eslint-disable no-undef */
/* eslint-env node */
/* global AFX_UTEST */
// Copyright (c) 2020 Siemens

/**
 * @module js/installedLocales
 */
import cfgSvc from 'js/configurationService';
import { processI10n, parseImports } from './utils';

// revisit me - code below might not be compatible for sample app, we need to see how can
// we support that
cfgSvc.add( 'installedLocales', AFX_UTEST ?
    // revisitme - quick mock for test, in general 'test code in production' is bad smell
    [ 'en_US', 'cs_CZ', 'de', 'es', 'fr', 'it', 'ja_JP', 'ko_KR', 'pl_PL', 'pt_BR', 'ru_RU', 'zh_CN', 'zh_TW' ] :
    ["en_US","cs_CZ","de","es","fr","it","ja_JP","ko_KR","pl_PL","pt_BR","ru_RU","zh_CN","zh_TW"]
);
